import GetDataFeomUser from "./pages/getDataFromUser";
import '../css/game.css'

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        }
    }

    render() {
        return (
            <div>

                <Router>
                    <Switch>

                        <Route path="/">
                            <GetDataFeomUser/>
                        </Route>

                    </Switch>
                </Router>
            </div>
        );
    }
}
export default App;
